var formattedEvents = []; 
var eventObj = {}; 
var pull_actions = {
	"opened" 					: "CREATED",
	"edited" 					: "UPDATED",
	"closed" 					: "UPDATED",
	"reopened"	 				: "UPDATED",
	"labeled" 					: "UPDATED",
	"unlabeled" 				: "UPDATED",
	"Assigned" 					: "UPDATED",
	"Unassigned" 				: "UPDATED",
	"review_requested"	 		: "UPDATED",
	"review_request_removed" 	: "UPDATED"
};

var webhook_type = events.eventHeaders["x-github-event"];
var webhook_action;

if (webhook_type == "pull_request") {
	eventObj.event_object_type = 'pull-requests';
	eventObj.event_object_id = events.number;
	webhook_action = events.action;
	eventObj.event_type = pull_actions[webhook_action];

}

if (events.hasOwnProperty("ref")) {
	eventObj.event_object_id = events.ref;
	eventObj.event_object_type = 'branches';
	if (webhook_type == "create") {
		eventObj.event_type = "CREATED";
	}
	if (webhook_type == "push") {
		eventObj.event_type = "UPDATED";
	}
	if (webhook_type == "delete") {
		eventObj.event_type = "DELETED";
	}
}


formattedEvents.push(eventObj);
done({ 
 "events" : formattedEvents 
});
